        "description": "<p>Left house in morning. Car filled with leftovers from party. Frantically writing thank you note to Jackson\u2019s parents. At the gas station, Jackson tried to put water in the tires. <i>We stop and try to figure out who is driving next. I say, \u201cwhoever is most assertive.\u201d When I get to the driver\u2019s seat Steven is already sitting there.-AS</i> Drove up highway 1; everything was on fire. Sign on road: \u201cLet\u2019s protect both elk and cow - build elk fences now!\u201d Everybody kept passing Conor cause the roads were so winding.</p><p>We listened to Shark Saddle. Jackson remarks: \u201cI like Pumpkin Bread better.\u201d <i>I\u2019m surprised Shark Saddle is actually pretty good cause it wasn\u2019t very fun.-AS</i></p><p></p><p>Confusion Hill</p><p>\t-\u201dI\u2019m confused\u201d</p><p>\t-\u201dI think we\u2019re gonna start seeing a lot of this kind of stuff.\u201d (Jackson)</p><p></p><p>\u201cCatch the crow\u201d</p><p></p><p>Tried to find a campground; got lost in sinkyone wilderness area somewhere between road A and road B. \u201cManatee in the Mailbox.\u201d</p><p></p><p>\u201cThorn Junction\u201d (voice memo in day 1 folder)</p><p></p><p><i>Camped that night, after driving to black sand beach. Set up tent in the dark. Steven was right about where to camp, and we decided Steven was always right. Jackson was right about how to set up the tent. We were all wearing flannels except for Aidan, who I think teased us for all wearing flannels. I ate the leftover pasta with my pocket knife blade. Tried to rehearse for our gig by singing in the dark </i>(voice memo in day 1 folder)<i>. We were really tired.</i></p><p></p><p><i>We didn\u2019t have our bear canisters. We didn\u2019t get eaten. We learned not to trust Jackson. It was a good night. -AS</i></p><p></p><p>We hypothesized that even though we didn\u2019t see any bears, they were probably encircling our picnic table as we ate dinner and were waiting in the darkness to eat the rest of our food (or us). </p>",
