        "date": "Wednesday, September 6",
        "day_num_UI": 3,
        "description": "<p>At this point, we\u2019ve already spent like $200 on gas.</p><p>Drove up the hill to Pittock Mansion to see view of Portland. \u00a0Saw giant yellow slug. Had a passionate debate about the color. (It was definitely yellow -SM).</p><p>Heart coffee shop in downtown portland. Weird drinks. Aidan got Conor a job at the church. Jackson forgot his pillow and returned to the house to retrieve a pillow which turned out not to be his. Various people in Portland compliment Conor\u2019s hat (thanks to Steven\u2019s suggestion that Portland is the perfect place to wear such a hat if you want compliments). \u00a0Then bookstore, wherein we get: <i>A</i> <i>Certain</i> <i>Lukas</i> by Julio Cortazar, <i>Secret Agent </i>by Joseph Conrad, and maybe some Neruda.</p><p></p><p>Garlic wheat thins.</p><p></p><p>Podcasts, then Elk. Followed by protecting the elk, and explaining to another passerby that there were elk crossing the road, who replied \u201cyeah they\u2019ll do that.\u201d</p><p></p><p>Ferry to victoria. Going through immigration. Jackson\u2019s alibi was really confusing. We were very worried about having our fruits and vegetables confiscated. \u00a0Worked on bios for church on the ferry. Hostel, the \u201cocean island inn,\u201d weird free drinks in hostel, working on first draft of \u201ccorner of my mind\u201d in hostel, then drinks with bandcamp. Keisha didn\u2019t realize that Conor was the guy she talked to about applying for a job. Walked around victoria at night.</p><p></p><p><i>Drank a strong drink in the morning. Tonic water, house honey and an espresso shot. It was pretty bad but made me feel crazy.</i></p><p></p><p>Got a lot done and then went to eat some tortas. The place was hip. Tried Jackson\u2019s good but grainy horchata.</p><p></p><p>Then on the road. Saw many elk in the swamp. Conor was among the first to spot the elk, and had to prove to himself and the group that they were not a mirage. We doubled back and got out of the car to see them and they were gone-most at least. We figured they were crossing the road so we walked back in the other direction. Tried to flag down traffic as they crossed. One van didn\u2019t want to slow down and just missed elk. Conor got video. The van was right next to us later in the ferry. Lots of cars close together in the car ferry. Friendly white bald guy at customs. Got to hostel. Woman working plays Celtic fiddle. Hostel fed us lentils and vodka ice tea drink. Lentils good, vodka bad. Worked on song and played it with Conor. Then out for drinks with Jackson\u2019s band camp friends. Vancouver seems cool. Hip like Montreal. Lots of homeless people. Pretty and clean. Feels bumpin\u2019 for a Wednesday. The water is nice. It\u2019s chilly and makes me nostalgic for fall. -AS</p>",
