        "description": "<p>Picked up Alicia at airport! Went to safeway and starbucks (ironically). Conor got a free coffee.</p><p>Morning in Seattle, long driving day, hurt my back sleeping on small couch. Lots of talk about acres in the car. Lots of talk about state mottos in the AIR BnB. \u00a0</p><p></p><p>Postcard to Maura. Jackson drew his part while driving. (Video in folder)</p><p></p><p>Alicia very very happy to see everyone again (and to have transformed magically from a strawman!) Made sandwiches at starbucks.</p><p></p><p>Propositional logic of the seating arrangement:</p><p>If Jackson is driving, it is the morning, because Jackson always begins the day\u2019s drive. Also, if Jackson is driving, he is multitasking because he excels at ordinary tasks while driving. If Conor is driving, Jackson is in the passenger seat because he will be uncomfortable in the back seat, due to his size. If Jackson is in the back seat, he is grumpy. If Conor is driving, Aidan or Steven might also be uncomfortable because invariably one of them will want to stop to pee, and Conor will not want to stop. If Conor is driving and Jackson is in the passenger seat, Jackson takes up a secretarial office for Conor and works on both his and Conor\u2019s laptops simultaneously. If Conor is driving and Jackson is in the backseat, Steven is in the front seat and we are listening to guitar players. If Aidan is driving, Steven or Jackson are in the passenger seat. If Aidan is driving, Conor is not sleeping. If Aidan is driving and Steven is in the passenger seat, we are listening to Tim O\u2019Brien, Della Mae, or John Coltrane. If Alicia is driving, we are in the middle of the country. If Steven is driving, it is night time. If Jackson is driving and we stop at a gas station, Jackson fills up the tank. If anybody else is driving and we stop at a gas station, Jackson fills up the tank. If we stop at a gas station, Steven purchases potato chips.</p><p></p><p>At this point everyone has acquired a role in the car:</p><p>-Aidan refills water bottles and chews a lot of gum.</p><p>-Steven notices when we are out of gas.</p><p>-Jackson\u2019s really good at unpacking and repacking the trunk. \u00a0</p><p>-Conor\u2019s really good at making the sleeping bags fit in the overhead bin.</p><p>-Alicia and Aidan make great peanut butter and jelly sandwiches.</p><p></p><p>\u201cHammer in the road\u201d</p><p></p><p>Hazy skies in Idaho in Montana. Listening to Gregory Alan Isakov at night and singing along.</p><p></p><p>\u201cSpokane like a true Montaner\u201d</p><p></p><p>Rest stop exercises:</p><p>Aerobics with aidan</p><p>stretching/stepping/stairs with steven</p><p>Cardio with conor</p><p>Jumping jacks with jackson</p><p>Abs with alicia</p><p></p><p>Guy in the gas station who said he couldn\u2019t pee on the side of the road because since he had a dog with him, it would be considered a felony. Then said, \u201cjust kidding, the police are great.\u201d Then left without washing his hands. Said, \u201cI only wash hands when I pee on them.\u201d We were confused. We all ran around the car a few times for exercise. </p><p></p><p>Conor drove for 530 miles. Set top speed record at 117mph. This during business meeting (photo in folder, Maura being skyped in).</p><p></p><p>Stopped for pizza for dinner. People were very friendly. Ms. America worked at this restaurant? (ASZ thinks it was Ms. Montana). There were twigs on the walls. Everyone had to pick their favorite extravagant decoration in the restaurant. </p><p></p><p>Story in the car about Jackson being in love with toast. The last line: \u201cWhy does love always disappear?\u201d Lots of unconventional relationships between inanimate objects in story. \u00a0Steven said lots of funny things. Everyone adopting Aidanisms.</p><p></p><p>Conor slept with Steven, who did not steal the blankets.</p>",
