        "description": "<p>Left Kansas City. Ate waffles in the morning. Gave Aidan\u2019s Grandparents a signed photo. Aidan brought everyone to 38th and Garfield, the spot where his family recovered all of their stuff from the side of the road after it was stolen. </p><p></p><p>We had a great singing rehearsal in the car. \u00a0Most of us tend to be a little flat, except for Jackson who tends to be a little sharp. <i>I felt stressed because I don\u2019t like singing. -SM</i></p><p></p><p>A really big pigeon bounced off our windshield for no reason and we felt bad :( </p><p></p><p>Arrived in Madison. We were confused by college students. Felt superior and strange. Saw the house Aidan lived in for the first months of his life.<i> </i>While waiting for Adam to show up, Aidan played tenor banjo on his front lawn. Had a conversation with a guy there about banjo. Adam showed up and we ate pizza. Then, went to radio show. After went out to a bar. Tried local beer. Aidan played Dylan songs with random people outside.</p><p></p><p>Conor slept with Adam, who woke him up in the middle of the night with weird barking sounds. Conor has a hard time going back to sleep after this.</p>",
